import React, { useState } from "react";
import logo from "../img/logo_transparent.png";

function FlowerNav(cost) {
  return (
    <nav>
      <img src={logo} alt="" />
      <ul>
        <li>Main page</li>
        <li cost={cost}>Shop</li>
        <li>About</li>
        <li>Contact</li>
      </ul>
    </nav>
  );
}

export default FlowerNav;
